import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { StyleSheet, Text, View } from 'react-native';
import { SafeAreaProvider } from 'react-native-safe-area-context';
import InitialLogo from './src/initial/InitialLogo';
import LoadingApp from './src/initial/LoadingApp';
import Constants from 'expo-constants';
import { NavigationContainer, useNavigation } from '@react-navigation/native';
import { createNativeStackNavigator } from '@react-navigation/native-stack';
import registrar from './src/pages/registrar/registrar';
import TelaInicio from './src/pages/TelaInicio/TelaInicio';

const Stack = createNativeStackNavigator();
const BGColor = "#4D4A95"

export default function App({navigation}) {
  return (
    <NavigationContainer>
      <SafeAreaProvider>
        <StatusBar style='auto' />
        <Stack.Navigator>
        <Stack.Screen name="LoadingApp" component={LoadingApp} options={{
            headerShown: false
          }}/>
          <Stack.Screen name="InitialLogo" component={InitialLogo} options={{
            headerShown: false
          }}/>
          <Stack.Screen name="registrar" component={registrar} options={{
            title: "",
            headerTransparent: true,
            headerShadowVisible: false,
            headerTintColor: 'white'
          }}/>
          <Stack.Screen name="TelaInicio" component={TelaInicio} options={{
            headerShown: true
          }}/>
        </Stack.Navigator>
      </SafeAreaProvider>
    </NavigationContainer>
  );
}
